しっとりクリーム感触なのに、指でのばすとさらさらパウダーにチェンジ。<br>肌にとけこみ、ジューシーな血色肌に仕上げるチークです。<br>血色感アップカラーと濡れつやカラー、2つの質感のかけ合わせで、異なる仕上がりが楽しめます。<br>【カラー】<br>★OR381<br>★RD382<br>★RD483<br>★PK384<br><br>【使用方法】<br>●血色感アップカラーを指先にとり、ほおの高いところを中心に軽い力でなじませます。<br>●濡れつやカラーを指先にとり、血色感アップカラーのまわりなどに重ねづけをすると、つややかな仕上がりを演出できます。<br><br>【使用上の注意】<br>◇ご使用後は、必ずフタをきちんと閉めて下さい。<br>◇衣類についた場合は、すぐにていねいに洗い流してください。<br>◇日のあたるところや高温・多湿のところにおかないでください。<br>中味がやわらかくなり、溶けだしたり、表面の色が淡くなることがあります。その場合は、ティッシュペーパーなどで軽くふくと元にもどります。<br><br><br>【広告文責】株式会社ワンステップ<br>TEL：0570-550-860<br>【メーカー名】資生堂ジャパン株式会社<br>【区分】日本製・化粧品<br><br>▼お届地域について<br>商品の配送区域は、日本国内に限らせて頂きます。<br>海外への発送は承っておりませんので、あらかじめご了承くださいませ。<br>※商品の性質などにより、一部お届け地域を制限させていただいている場合もございます。くわしくは各商品詳細画面にてご確認下さい。<br><br><br>■商品詳細<br><table width=630 border=1 cellspacing=0><tr><td bgcolor=#ffffcc><p style=margin:10px;>メーカー名：資生堂<br>シリーズ名：インテグレート<br>種類別名称：チーク<br>原産国：日本<br><br>購入単位：1個<br>配送種別：在庫品</p></td></tr></table><br><br><img src=http://image.rakuten.co.jp/onestep/cabinet/life/cosme03/shiseido.jpg width=150><br><br><table width=600 border=0 cellspacing=0><tr><td><font size=1>【検索用キーワード】<br>4901872055395 4901872055401 4901872055418 4901872055425 KS2090 KS2091 KS2092 KS2093 OR381 RD382 RD483 PK384 資生堂 しせいどう シセイドウ SHISEIDO shiseido INTEGRATE integrate インテグレート メイク メイク道具 メイク用品 化粧 化粧品 化粧道具 メイクグッズ メイクアップ ポイントメイク チーク ちーく 頬紅 ほお紅 頬 ほっぺた クリーム パウダー 血色感 メルティーモードチーク メルティー モード オレンジ ブラウン 茶色 ベージュ レッド 赤 ピンク アイボリー</font></td></tr></table><style type="text/css">
